INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 4, 110501, 0.0, 10021, 24015, 1, "2030/12/17 14:59:59", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 24, 4, 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("カオリ（サマー）", 4.0, "2019/07/31 12:00:00", 4, 110501, 0.0, 10021, 24016, 2, "2030/12/17 14:59:59", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 24, 1, 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 4, 110501, 0.0, 10021, 24017, 3, "2030/12/17 14:59:59", "マジムンだらけで目が回るさ～！\nふらふらさ～！", 24, 4, 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("カオリ（サマー）", 5.2, "2019/07/31 12:00:00", 1, 110501, 0.0, 10021, 24018, 4, "2030/12/17 14:59:59", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 24, 2, 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("カオリ（サマー）", 4.2, "2019/07/31 12:00:00", 5, 110501, 0.0, 10021, 24019, 5, "2030/12/17 14:59:59", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 24, 6, 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 2, 110501, 0.0, 10021, 24020, 6, "2030/12/17 14:59:59", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 24, 2, 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("カオリ（サマー）", 6.4, "2019/07/31 12:00:00", 1, 110501, 0.0, 10021, 24021, 7, "2030/12/17 14:59:59", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 24, 6, 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 2, 110501, 0.0, 10021, 24022, 8, "2030/12/17 14:59:59", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 24, 2, 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("カオリ（サマー）", 10.08, "2019/07/31 12:00:00", 6, 110501, 0.0, 10021, 24023, 9, "2030/12/17 14:59:59", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 24, 3, 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("カオリ（サマー）", 5.0, "2019/07/31 12:00:00", 1, 110501, 0.0, 10021, 24024, 10, "2030/12/17 14:59:59", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 24, 2, 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 2, 110501, 0.0, 10021, 24025, 11, "2030/12/17 14:59:59", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 24, 2, 0.0);
